"436167":{"id":"436167","name":"Mulheres Divinas","slug":"mulheres-divinas","original_title":"Die göttliche Ordnung","overview":"Suíça, 1971: Nora é uma jovem dona de casa e mãe que vive com o marido e seus dois filhos em uma pequena vila pacífica. Aqui, no campo suíço, pouco ou nada se sente das grandes revoltas sociais que o movimento de maio de 1968 causou. A vida de Nora, também, não foi afetada; ela é uma pessoa reservada, calma, muito querida por todos - até quando ela começou a fazer ativamente campanha publica pelo direito de voto das mulheres, uma questão que será colocada diante dos eleitores do sexo masculino em 7 de fevereiro de 1971.","first_air_date":"2017-03-09","runtime":96,"episode_run_time":[96],"vote_average":7.3,"created_by":["Zodiac Pictures"],"production_companies":[{"name":"Zodiac Pictures"}],"cast":["Marie Leuenberger","Maximilian Simonischek","Marta Zoffoli","Bettina Stucky","Rachel Braunschweig"],"backdrop_path":"https://image.tmdb.org/t/p/original/1Zf8KuRm1yJhvZJi7QNxV8yjclz.jpg","poster_path":"https://image.tmdb.org/t/p/original/2rPV98l3cFbA015NPlhQNieFz4V.jpg","certification":"14","genres":["Comédia","Drama"],"trailer":"N/A"},
