"355254":{"id":"355254","name":"De Palma","slug":"de-palma","original_title":"De Palma","overview":"O diretor estadunidense Brian De Palma já passou por momentos muito diferentes em sua carreira: começou com produções experimentais, foi convidado a trabalhar em Hollywood e conquistou alguns sucessos marcantes, como em Os Intocáveis, mas também acumulou fracassos que colocaram a sua carreira em risco. O próprio diretor narra sua história, filme a filme, ressaltando as principais parcerias, as decepções, a amizade com Francis Ford Coppola, Martin Scorsese e Steven Spielberg e as lições aprendidas com o cinema de Alfred Hitchcock.","first_air_date":"2016-06-10","runtime":110,"episode_run_time":[110],"vote_average":7.1,"created_by":["Boxmotion","Empire Ward"],"production_companies":[{"name":"Boxmotion"},{"name":"Empire Ward"}],"cast":["Brian De Palma"],"backdrop_path":"https://image.tmdb.org/t/p/original/grVKCMGxeQlungQskzxEWQq8VE9.jpg","poster_path":"https://image.tmdb.org/t/p/original/uYYxSGwKWrnN86Uyuk0NyDzCLwh.jpg","certification":"N/A","genres":["Documentário"],"trailer":"4tW0NA3Omaw"},
