"748783":{"id":"748783","name":"Garfield - Fora de Casa","slug":"garfield-fora-de-casa","original_title":"The Garfield Movie","overview":"Garfield, o mundialmente famoso gato de interior que odeia segundas-feiras e adora lasanha, está prestes a ter uma aventura selvagem ao ar livre! Depois de um reencontro inesperado com seu pai há muito perdido – o desalinhado gato de rua Vic – Garfield e seu amigo canino Odie são forçados a deixar sua vida perfeitamente mimada para se juntarem a Vic em um assalto hilariante e de alto risco.","first_air_date":"2024-04-30","runtime":100,"episode_run_time":[100],"vote_average":7.1,"created_by":["Alcon Entertainment","DNEG","Wayfarer Studios","One Cool Group","Stage 6 Films","Andrews McMeel Entertainment","John Cohen Productions"],"production_companies":[{"name":"Alcon Entertainment"},{"name":"DNEG"},{"name":"Wayfarer Studios"},{"name":"One Cool Group"},{"name":"Stage 6 Films"},{"name":"Andrews McMeel Entertainment"},{"name":"John Cohen Productions"}],"cast":["Chris Pratt","Samuel L. Jackson","Hannah Waddingham","Ving Rhames","Nicholas Hoult"],"backdrop_path":"https://image.tmdb.org/t/p/original/P82NAcEsLIYgQtrtn36tYsj41m.jpg","poster_path":"https://image.tmdb.org/t/p/original/WbnxK16vL7tSJl35GlnICa0ztP.jpg","certification":"L","genres":["Animação","Comédia","Família","Aventura"],"trailer":"0yIO8HHoB0g"},
