"502356":{"id":"502356","name":"Super Mario Bros. O Filme","slug":"super-mario-bros-o-filme","original_title":"The Super Mario Bros. Movie","overview":"Os irmãos Mario e Luigi, de ascendência italiana, vivem em Brooklyn (Nova Iorque), onde trabalham como canalizadores. Certo dia, durante um serviço de reparação de uma conduta de água, são sugados por um tubo e transportados para o Reino Cogumelo, um universo paralelo governado pela Princesa Peach. Sem saber do paradeiro do irmão, Mario vai ter de aprender a sobreviver naquele lugar, adquirindo capacidades bizarras mas que serão grandes mais-valias para destruir os planos de Bowser, um verdadeiro vilão que tenciona dominar o mundo.","first_air_date":"2023-04-05","runtime":92,"episode_run_time":[92],"vote_average":7.6,"created_by":["Universal Pictures","Illumination","Nintendo"],"production_companies":[{"name":"Universal Pictures"},{"name":"Illumination"},{"name":"Nintendo"}],"cast":["Chris Pratt","Anya Taylor-Joy","Charlie Day","Jack Black","Keegan-Michael Key"],"backdrop_path":"https://image.tmdb.org/t/p/original/9n2tJBplPbgR2ca05hS5CKXwP2c.jpg","poster_path":"https://image.tmdb.org/t/p/original/ktU3MIeZtuEVRlMftgp0HMX2WR7.jpg","certification":"L","genres":["Animação","Família","Aventura","Fantasia","Comédia"],"trailer":"iL6-Q62CjbA"},
