"940551":{"id":"940551","name":"Patos!","slug":"patos","original_title":"Migration","overview":"A família Mallard está um pouco refém da rotina. Enquanto Mack, o pai, se contenta em manter sua família segura nos arredores de um lago da Nova Inglaterra para sempre, Pam, a mãe, está ansiosa para agitar as coisas e mostrar a seus filhos – o adolescente Dax e a patinha Gwen – o mundo inteiro. Quando uma família de patos migratórios aterrissa em seu lago com histórias emocionantes de lugares distantes, Pam convence Mack a embarcar em uma viagem em família, via Nova York, para a Jamaica tropical.","first_air_date":"2023-12-06","runtime":83,"episode_run_time":[83],"vote_average":7.4,"created_by":["Universal Pictures","Illumination"],"production_companies":[{"name":"Universal Pictures"},{"name":"Illumination"}],"cast":["Kumail Nanjiani","Elizabeth Banks","Caspar Jennings","Tresi Gazal","Awkwafina"],"backdrop_path":"https://image.tmdb.org/t/p/original/gklkxY0veMajdCiGe6ggsh07VG2.jpg","poster_path":"https://image.tmdb.org/t/p/original/wXWnUhdnSuADRp9w7aAZNHx682v.jpg","certification":"L","genres":["Animação","Aventura","Comédia","Família"],"trailer":"UUorP1-n6qk"},
