"812":{"id":"812","name":"Aladdin","slug":"aladdin","original_title":"Aladdin","overview":"Após o sultão ordenar que sua filha, a princesa Jasmine, ache um marido rapidamente, ela foge do palácio. Jasmine encontra um tipo meio malandro, Aladdin, que conquista seu coração. Porém ambos são achados pelos guardas de Jafar, o vizir do sultão. Jafar criou um feitiço para dominar o sultão, se casar com Jasmine e se tornar ele mesmo o sultão. Além disto finge que cometeu um engano e mandou decapitar Aladdin, que na verdade está vivo, pois Jafar precisa dele para conseguir uma lâmpada mágica, que é a morada de um poderoso gênio. Mas o plano de Jafar falha, pois Aladdin fica com a lâmpada graças a intervenção de um pequeno macaco, Abu, seu fiel mascote. Quando descobre que há na lâmpada um gênio poderoso, que pode se transformar em qualquer pessoa ou coisa e que lhe concederá três desejos, Aladdin planeja usá-los para conquistar Jasmine, sem imaginar que Jafar é um diabólico inimigo, que precisa ser detido.","first_air_date":"1992-11-25","runtime":93,"episode_run_time":[93],"vote_average":7.7,"created_by":["Walt Disney Pictures","Walt Disney Feature Animation"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Walt Disney Feature Animation"}],"cast":["Scott Weinger","Robin Williams","Linda Larkin","Jonathan Freeman","Gilbert Gottfried"],"backdrop_path":"https://image.tmdb.org/t/p/original/5OeY4U2rzePxWq2rkqMajUx2gz7.jpg","poster_path":"https://image.tmdb.org/t/p/original/qYB8MwE6AgLFe5ruBUmPA0RWRPY.jpg","certification":"L","genres":["Animação","Família","Aventura","Fantasia","Romance"],"trailer":"N/A"},
