"1104844":{"id":"1104844","name":"BLUE LOCK O FILME -EPISÓDIO NAGI-","slug":"blue-lock-o-filme-episodio-nagi","original_title":"劇場版ブルーロック -EPISODE 凪-","overview":"“Que chatice.” Essa foi a frase favorita de Nagi Seishiro, um garoto do segundo ano do Ensino Médio, ao longo de toda a sua vida tediosa. Até que Mikage Reo, um colega que sonhava em vencer a Copa do Mundo, descobriu a habilidade escondida de Nagi, inspirando-o a jogar futebol e compartilhar seu talento fenomenal. Um dia, ele recebe um convite para o misterioso projeto BLUE LOCK. O que o espera é um encontro com os melhores atacantes, vindos de todo o país. O sonho de Nagi de se tornar o melhor, ao lado de Reo, vai levar este fenômeno para um mundo que ele jamais conheceu.","first_air_date":"2024-04-19","runtime":91,"episode_run_time":[91],"vote_average":7.3,"created_by":["8bit"],"production_companies":[{"name":"8bit"}],"cast":["Nobunaga Shimazaki","Yuma Uchida","Kazuyuki Okitsu","Kazuki Ura","Tasuku Kaito"],"backdrop_path":"https://image.tmdb.org/t/p/original/dJwclPgKPnV7hX3OSlvSBiCmuvB.jpg","poster_path":"https://image.tmdb.org/t/p/original/sqI1kanuRF6VHRunhbEUVHh8BKV.jpg","certification":"12","genres":["Animação","Ação","Drama"],"trailer":"4wbhOYBrQ6Q"},
"317442":{"id":"317442","name":"The Last: Naruto O Filme","slug":"the-last-naruto-o-filme","original_title":"THE LAST -NARUTO THE MOVIE-","overview":"Dois anos após os eventos da quarta Grande Guerra Ninja, a lua está iniciando uma trajetória de colisão com a Terra. A contagem regressiva para a sobrevivência do planeta começa! Em meio ao caos, a irmã mais nova de Hinata, Hanabi, é capturada pelo misterioso inimigo Toneri Otsutsuki. Naruto deve superar grandes perigos em uma missão para salvar Hanabi e o mundo, juntamente com Hinata, Sai, Shikamaru e Sakura.","first_air_date":"2014-12-06","runtime":112,"episode_run_time":[112],"vote_average":7.4,"created_by":["Aniplex","Pierrot","Bandai Visual","dentsu","Shueisha","TV Tokyo"],"production_companies":[{"name":"Aniplex"},{"name":"Pierrot"},{"name":"Bandai Visual"},{"name":"dentsu"},{"name":"Shueisha"},{"name":"TV Tokyo"}],"cast":["竹内順子","Nana Mizuki","Jun Fukuyama","中村千絵","Showtaro Morikubo"],"backdrop_path":"https://image.tmdb.org/t/p/original/l8ubUlfzlB5R2j9cJ3CN7tj0gmd.jpg","poster_path":"https://image.tmdb.org/t/p/original/sKn9V7hvkxJqFWBhNLHStbpHUIN.jpg","certification":"10","genres":["Ação","Romance","Animação"],"trailer":"YEc3m3tGYcY"},
