"62211":{"id":"62211","name":"Universidade Monstros","slug":"universidade-monstros","original_title":"Monsters University","overview":"Desde pequeno, Mike Wazowski sonha em ser um assustador e sabe que os melhores assustadores estudam na Universidade Monstros (UM). Mas durante seu primeiro semestre na UM, os planos de Mike desmoronam quando ele cruza o caminho do espertinho James P. Sullivan, um assustador nato. O espírito competitivo descontrolado da dupla faz com que ambos sejam expulsos do programa mais assustador da Universidade. Então eles percebem que se quiserem realizar seus sonhos, terão que trabalhar em equipe junto com um grupo de monstros marginalizados.","first_air_date":"2013-06-19","runtime":104,"episode_run_time":[104],"vote_average":7.0,"created_by":["Pixar","Walt Disney Pictures"],"production_companies":[{"name":"Pixar"},{"name":"Walt Disney Pictures"}],"cast":["Billy Crystal","John Goodman","Steve Buscemi","Helen Mirren","Peter Sohn"],"backdrop_path":"https://image.tmdb.org/t/p/original/hmAOMwVeJfdWXgK1Ikyl2eYkE99.jpg","poster_path":"https://image.tmdb.org/t/p/original/gRNSCtyFGspt1iVKWzQZ9sJiTYW.jpg","certification":"L","genres":["Animação","Família"],"trailer":"KlA-qAG3VCc"},
