"76492":{"id":"76492","name":"Hotel Transilvânia","slug":"hotel-transilvania","original_title":"Hotel Transylvania","overview":"O Hotel Transilvânia é um resort cinco estrelas que serve de refúgio para que os monstros possam descansar do árduo trabalho de perseguir e assustar os humanos. O local é comandado pelo Conde Drácula, que resolve convidar os amigos para comemorar o 118º aniversário de sua filha, Mavis. O que ele não esperava era que Jonathan, um humano sem noção, fosse aparecer no local justo quando o hotel está repleto de convidados e, ainda por cima, se apaixonasse por Mavis.","first_air_date":"2012-09-20","runtime":91,"episode_run_time":[91],"vote_average":7.0,"created_by":["Columbia Pictures","Sony Pictures Animation"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Sony Pictures Animation"}],"cast":["Adam Sandler","Andy Samberg","Selena Gomez","Kevin James","Fran Drescher"],"backdrop_path":"https://image.tmdb.org/t/p/original/5rARlA8beRAVXPYzSaF2NoS8Ry5.jpg","poster_path":"https://image.tmdb.org/t/p/original/i9kAWShk7qrqril2dLboP0hi8I2.jpg","certification":"L","genres":["Animação","Comédia","Família","Fantasia"],"trailer":"fWbs2GlUaO0"},
