"38055":{"id":"38055","name":"Megamente","slug":"megamente","original_title":"Megamind","overview":"Tudo o que vilão Megamente mais queria era eliminar seu adversário Metro Man e assim dominar a cidade de Metro City. Só que para isso era necessário um plano ainda mais diabólico do que todos já tentados anteriormente. Um dia, com a ajuda de Criado e após sequestrar a repórter Rosane Rocha, o malvado consegue o inimaginável, para ele e para todos: dar um sumiço no herói. A única coisa que ele não contava era que sua vida se tornaria tão chata a ponto de ele inventar um herói para combater.","first_air_date":"2010-10-28","runtime":96,"episode_run_time":[96],"vote_average":7.0,"created_by":["DreamWorks Animation","Pacific Data Images"],"production_companies":[{"name":"DreamWorks Animation"},{"name":"Pacific Data Images"}],"cast":["Will Ferrell","Tina Fey","Jonah Hill","Brad Pitt","David Cross"],"backdrop_path":"https://image.tmdb.org/t/p/original/irpJXGiVr539uuspcQcNdkhS2lq.jpg","poster_path":"https://image.tmdb.org/t/p/original/juB6OgnyYQa9lCPhaiTBlciibK6.jpg","certification":"L","genres":["Animação","Ação","Comédia","Família","Ficção científica"],"trailer":"N/A"},
"11360":{"id":"11360","name":"Dumbo","slug":"dumbo","original_title":"Dumbo","overview":"Dumbo é um bebé elefante que nasceu com umas orelhas enormes. Um dia ele conhece Timóteo, um ratinho que mete medo à maioria dos elefantes do circo onde vive Dumbo. Ao contrário do que se podia esperar, o rato e o elefante acabam por se tornar amigos e, juntos, eles tornam-se as maiores atracções do circo. Usando suas orelhas, Dumbo faz o que nenhum outro elefante consegue: voar!","first_air_date":"1941-10-31","runtime":63,"episode_run_time":[63],"vote_average":7.0,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Edward Brophy","Margaret Wright","Verna Felton","Sarah Selby","Noreen Gammill"],"backdrop_path":"https://image.tmdb.org/t/p/original/aRVQ1EgTx3vbhK6qls2O834bPQc.jpg","poster_path":"https://image.tmdb.org/t/p/original/hKDdllslMtsU9JixAv5HR9biXlp.jpg","certification":"L","genres":["Animação","Família"],"trailer":"N/A"},
"159824":{"id":"159824","name":"Hotel Transilvânia 2","slug":"hotel-transilvania-2","original_title":"Hotel Transylvania 2","overview":"Drácula percebe que seu neto, que é metade humano, não está mostrando seu lado vampiro. O avô preocupado, ao lado de seus amigos, decide colocar o menino em um treinamento especial enquanto Mavis e Johnny estão fora. Para piorar, o pai de Drácula aparece para uma visita.","first_air_date":"2015-09-21","runtime":89,"episode_run_time":[89],"vote_average":6.8,"created_by":["Columbia Pictures","Sony Pictures Animation","MRC"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Sony Pictures Animation"},{"name":"MRC"}],"cast":["Adam Sandler","Andy Samberg","Selena Gomez","Kevin James","Steve Buscemi"],"backdrop_path":"https://image.tmdb.org/t/p/original/ymHTXJabZagpXvXIR0litdXC8BT.jpg","poster_path":"https://image.tmdb.org/t/p/original/prBkRebn3rgLVboyxmEpjKaDJ1x.jpg","certification":"L","genres":["Animação","Comédia","Família","Fantasia"],"trailer":"KCQF_AmayN0"},
"175112":{"id":"175112","name":"Tinker Bell: Fadas e Piratas","slug":"tinker-bell-fadas-e-piratas","original_title":"Tinker Bell and the Pirate Fairy","overview":"Quando uma fada incompreendida chamada Zarina rouba o importantíssimo pó mágico azul e voa para longe a fim unir forças com os piratas da Pedra da Caveira, Tinker Bell e suas amigas fadas devem embarcar em uma aventura para devolvê-lo ao seu devido lugar. No entanto, em meio à busca por Zarina, o mundo de Tink é virado do avesso. Ela e suas amigas descobrem que seus respectivos talentos foram trocados e precisam correr contra o tempo para recuperar o pó azul, voltar para casa e salvar o Refúgio das Fadas.","first_air_date":"2014-02-13","runtime":78,"episode_run_time":[78],"vote_average":6.9,"created_by":["DisneyToon Studios"],"production_companies":[{"name":"DisneyToon Studios"}],"cast":["Mae Whitman","Christina Hendricks","Tom Hiddleston","Lucy Liu","Raven-Symoné"],"backdrop_path":"https://image.tmdb.org/t/p/original/vcLpxfpfKCKGiTlUx83CzKxRDT2.jpg","poster_path":"https://image.tmdb.org/t/p/original/e9OYTVqqQRWWeTur8MExfFvtIkq.jpg","certification":"L","genres":["Animação","Família"],"trailer":"N/A"},
"1012201":{"id":"1012201","name":"HAIKYU!! The Dumpster Battle","slug":"haikyu-the-dumpster-battle","original_title":"劇場版ハイキュー!! ゴミ捨て場の決戦","overview":"Shoyo Hinata se junta ao clube de vôlei do Karasuno High para ser como seu ídolo, um ex-jogador do Karasuno conhecido como o “Pequeno Gigante”. Mas Hinata logo descobre que deve se juntar a seu inimigo do ensino médio, Tobio Kageyama. Seus estilos conflitantes se transformam em uma arma surpreendente, mas será que eles conseguirão derrotar seu rival Nekoma High na tão aguardada “Dumpster Battle”, o tão aguardado confronto final entre duas equipes adversárias?","first_air_date":"2024-02-16","runtime":85,"episode_run_time":[85],"vote_average":7.6,"created_by":["Production I.G","TOHO","Shueisha","MBS","dentsu","Sony Music Entertainment","movic"],"production_companies":[{"name":"Production I.G"},{"name":"TOHO"},{"name":"Shueisha"},{"name":"MBS"},{"name":"dentsu"},{"name":"Sony Music Entertainment"},{"name":"movic"}],"cast":["Ayumu Murase","Kaito Ishikawa","Yuki Kaji","Yuichi Nakamura","Koki Uchiyama"],"backdrop_path":"https://image.tmdb.org/t/p/original/cZmOrIOkJ2SNfVdiO85dUbOAYnL.jpg","poster_path":"https://image.tmdb.org/t/p/original/pRfLrwbfUWmUj1Jh1NGLSQceHoT.jpg","certification":"12","genres":["Animação","Comédia"],"trailer":"oGy1x_i4GQo"},
