"9837":{"id":"9837","name":"O Príncipe do Egito","slug":"o-principe-do-egito","original_title":"The Prince of Egypt","overview":"No Egito antigo, quando os hebreus lá viviam como escravos e o faraó Seti, temendo o constante nascimento de crianças hebréias, pois no futuro poderiam se tornar uma força que ameaçasse seu poder, ordena que todos os bebês hebreus do sexo masculino sejam mortos. Uma hebréia se desespera ao ver que seu filho poderá ser morto e, para salvá-lo, o coloca em uma cesta no rio. A criança acaba sendo encontrada pela rainha, que o adota. Assim Moisés é criado como irmão de Ramsés, o herdeiro do trono de Seti. Os dois crescem e se tornam grande amigos, mas Moisés acaba descobrindo sua origem, decide abandonar o palácio e libertar os hebreus, para levá-los para a Terra Prometida.","first_air_date":"1998-12-16","runtime":99,"episode_run_time":[99],"vote_average":7.3,"created_by":["DreamWorks Pictures","DreamWorks Animation"],"production_companies":[{"name":"DreamWorks Pictures"},{"name":"DreamWorks Animation"}],"cast":["Val Kilmer","Ralph Fiennes","Michelle Pfeiffer","Sandra Bullock","Jeff Goldblum"],"backdrop_path":"https://image.tmdb.org/t/p/original/z0Yh4N38FUntBln5YMgHGtrimOZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/5jco6VjKwjAyN8HElg4F3dXGfT8.jpg","certification":"L","genres":["Aventura","Animação","Drama","Família"],"trailer":"N/A"},
"10340":{"id":"10340","name":"A Dama e o Vagabundo","slug":"a-dama-e-o-vagabundo","original_title":"Lady and the Tramp","overview":"A história de uma cachorrinha de classe chamada Lady que se sente abandonada pelos donos quando eles têm um bebê e acaba se envolvendo com um cachorro de rua conhecido como Vagabundo. Os dois terão que lidar com uma injusta tia que, com seus gatos de estimação, chegam na casa e acabam com o sossego de Lady.","first_air_date":"1955-06-22","runtime":77,"episode_run_time":[77],"vote_average":7.1,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Barbara Luddy","Larry Roberts","Peggy Lee","Bill Thompson","Bill Baucom"],"backdrop_path":"https://image.tmdb.org/t/p/original/yGgEg4yimYQJLZrZg3Qhogp2raQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/qKBA03V9LvfpvcNfUgAwdydRSA1.jpg","certification":"L","genres":["Família","Animação","Romance"],"trailer":"N/A"},
