"324852":{"id":"324852","name":"Meu Malvado Favorito 3","slug":"meu-malvado-favorito-3","original_title":"Despicable Me 3","overview":"O ex-ator mirim e astro de TV, Balthazar Bratt, foi um típico malvado bem-sucedido nos anos 80 e agora está de volta à ativa. Ele vai aterrorizar a vida de Gru, Agnes, Margo, Edith, Dr. Nefario e os atrapalhados Minions. Em meio a tudo isso, Gru também vai encontrar o seu irmão gêmeo, Drew.","first_air_date":"2017-06-15","runtime":90,"episode_run_time":[90],"vote_average":6.5,"created_by":["Illumination","Universal Pictures"],"production_companies":[{"name":"Illumination"},{"name":"Universal Pictures"}],"cast":["Steve Carell","Kristen Wiig","Trey Parker","Miranda Cosgrove","Dana Gaier"],"backdrop_path":"https://image.tmdb.org/t/p/original/ftRkFtAGuHngHnLiOxktq0aCVMF.jpg","poster_path":"https://image.tmdb.org/t/p/original/nJcT21OKUiS3XDxBo2IWafkSIMk.jpg","certification":"L","genres":["Ação","Animação","Comédia","Família","Aventura"],"trailer":"9XEHAP9UGfY"},
"13179":{"id":"13179","name":"Tinker Bell: Uma Aventura no Mundo das Fadas","slug":"tinker-bell-uma-aventura-no-mundo-das-fadas","original_title":"Tinker Bell","overview":"Entre no mundo secreto do Refúgio das Fadas e ouça a voz de Tinker Bell pela primeira vez nessa emocionante história da fada mais famosa da Disney, que finalmente ganha o seu primeiro e inédito longa-metragem, Tinker Bell - Uma Aventura no Mundo das Fadas. Você já parou para pensar como a natureza se transforma - e quem lhe dá as luzes e cores de cada estação que inicia e termina? Viaje para esse mundo de aventura e mistério enquanto Tinker Bell e suas quatro melhores amigas fadas transformam o inverno em primavera e, como a força da da fé, confiança e um pouquinho de pozinho mágico, descubra a importância de ser verdadeiro com você mesmo. Transbordando de alegria e imaginação, Tinker Bell é a celebração da mais amada fada da Disney e do seu primeiro longa-metragem. Conheça essa fantástica história feita para divertir e entreter toda a família.","first_air_date":"2008-09-11","runtime":78,"episode_run_time":[78],"vote_average":6.9,"created_by":["DisneyToon Studios","Prana Animation Studios"],"production_companies":[{"name":"DisneyToon Studios"},{"name":"Prana Animation Studios"}],"cast":["Mae Whitman","Kristin Chenoweth","Raven-Symoné","Lucy Liu","America Ferrera"],"backdrop_path":"https://image.tmdb.org/t/p/original/maeox8nZYIxAAE4SdyLA0VOXe1x.jpg","poster_path":"https://image.tmdb.org/t/p/original/x3jDIWe2Tu68BgH6LE20q1cFCVU.jpg","certification":"L","genres":["Animação","Família","Aventura","Fantasia"],"trailer":"N/A"},
"9323":{"id":"9323","name":"Ghost in the Shell: O Fantasma do Futuro","slug":"ghost-in-the-shell-o-fantasma-do-futuro","original_title":"GHOST IN THE SHELL","overview":"Major Motoko Kusanagi, uma ciborgue do Setor de Segurança Pública 9, recebe a missão de capturar um hacker que está dominando a mente de humanos aperfeiçoados por computador. Mas ela acaba se envolvendo em uma trama de conspirações, que atinge interesses da alta cópula da política.","first_air_date":"1995-11-18","runtime":82,"episode_run_time":[82],"vote_average":7.9,"created_by":["Bandai Visual","Production I.G","Kodansha","Manga Entertainment"],"production_companies":[{"name":"Bandai Visual"},{"name":"Production I.G"},{"name":"Kodansha"},{"name":"Manga Entertainment"}],"cast":["田中敦子","大塚明夫","家弓家正","Koichi Yamadera","仲野裕"],"backdrop_path":"https://image.tmdb.org/t/p/original/gTRXgigmgKpeJjW07iq686HZyBD.jpg","poster_path":"https://image.tmdb.org/t/p/original/4YgDy47HKxcSwUPQWrg0J39lEZA.jpg","certification":"14","genres":["Ação","Animação","Ficção científica"],"trailer":"HGhZA8AV7C4"},
"1209288":{"id":"1209288","name":"Liga da Justiça: Crise nas Infinitas Terras - Parte Dois","slug":"liga-da-justica-crise-nas-infinitas-terras-parte-dois","original_title":"Justice League: Crisis on Infinite Earths Part Two","overview":"Um exército interminável de DEMÔNIOS SOMBRIOS, empenhados na destruição de todas as realidades, assola nosso mundo e todas as Terras paralelas! A única coisa que se opõe a eles é a mais poderosa equipe de meta-humanos já reunida. Mas nem mesmo o poder combinado de Superman, Batman, Mulher-Maravilha, Lanterna Verde e todos os seus colegas super-heróis consegue retardar o ataque dessa horda invencível. Que força misteriosa a move? E como os segredos ocultos do Monitor e da Supergirl ameaçam destruir nossa última defesa?","first_air_date":"2024-04-22","runtime":94,"episode_run_time":[94],"vote_average":6.9,"created_by":["Warner Bros. Animation","DC Entertainment"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"}],"cast":["Jensen Ackles","Darren Criss","Meg Donnelly","Stana Katic","Jonathan Adams"],"backdrop_path":"https://image.tmdb.org/t/p/original/tBmJCH9llj1Q9jDOS7vGWnl7GVj.jpg","poster_path":"https://image.tmdb.org/t/p/original/oQJWjO5aw5N4uCoh6CYrxf1LePv.jpg","certification":"12","genres":["Animação","Ficção científica","Ação"],"trailer":"f91n6Jk2IX8"},
"10527":{"id":"10527","name":"Madagascar 2: A Grande Escapada","slug":"madagascar-2-a-grande-escapada","original_title":"Madagascar: Escape 2 Africa","overview":"Alex, Marty, Melman, Gloria, Rei Julien, Maurice, os pinguins e os chimpanzés estão no longínquo litoral de Madagascar. Para deixar o local os pinguins consertam um velho avião de guerra, mas logo em seu 1º voo ele cai. Isto faz com que os animais do zoológico de Nova York tenham que lidar, pela 1ª vez na vida, com espécies semelhantes a eles, só que habituadas à vida selvagem.","first_air_date":"2008-10-30","runtime":89,"episode_run_time":[89],"vote_average":6.5,"created_by":["DreamWorks Animation","Pacific Data Images"],"production_companies":[{"name":"DreamWorks Animation"},{"name":"Pacific Data Images"}],"cast":["Ben Stiller","Chris Rock","David Schwimmer","Jada Pinkett Smith","Sacha Baron Cohen"],"backdrop_path":"https://image.tmdb.org/t/p/original/3yXLkSTrVhG66MIAr3X6C4gjccw.jpg","poster_path":"https://image.tmdb.org/t/p/original/j4If0LljCT2v6CZc86ah3kTshDw.jpg","certification":"L","genres":["Família","Aventura","Animação","Comédia"],"trailer":"N/A"},
"149":{"id":"149","name":"Akira","slug":"akira","original_title":"AKIRA","overview":"Uma grande explosão fez com que Tóquio fosse destruída em 1988. Em seu lugar, foi construída Neo-Tóquio, que, em 2019, sofre com atentados terroristas por toda a cidade. Kaneda e Tetsuo são amigos que integram uma gangue de motoqueiros. Eles disputam rachas violentos com uma gangue rival, os Palhaços, até que um dia, Tetsuo encontra Takashi, uma estranha criança com poderes que fugiu do hospital onde era mantido como cobaia. Tetsuo é ferido no encontro e, antes de receber a ajuda dos amigos, é levado por integrantes do exército, liderados pelo coronel Shikishima. A partir de então, Tetsuo passa a desenvolver poderes inimagináveis, o que faz com que seja comparado ao lendário Akira, responsável pela explosão de 1988. Paralelamente, Kaneda se interessa por Kei, uma garota envolvida com espiões, que tenta decifrar o enigma por trás das cobaias controladas pelo exército.","first_air_date":"1988-06-10","runtime":124,"episode_run_time":[124],"vote_average":7.9,"created_by":["MBS","Sumitomo Corporation","TOHO","Studio Fuga","Studio Aoi","Kodansha","Bandai Entertainment","Tokyo Movie Shinsha"],"production_companies":[{"name":"MBS"},{"name":"Sumitomo Corporation"},{"name":"TOHO"},{"name":"Studio Fuga"},{"name":"Studio Aoi"},{"name":"Kodansha"},{"name":"Bandai Entertainment"},{"name":"Tokyo Movie Shinsha"}],"cast":["岩田光央","佐々木望","Mami Koyama","石田太郎","鈴木瑞穂"],"backdrop_path":"https://image.tmdb.org/t/p/original/pHtVkUvKiG7CEemZkUiqPzjpMri.jpg","poster_path":"https://image.tmdb.org/t/p/original/tbwwTQ3EqSdotbQ3ZcIl6vKBv7q.jpg","certification":"14","genres":["Animação","Ficção científica","Ação"],"trailer":"ooKBenGK3R4"},
