"1267":{"id":"1267","name":"A Família do Futuro","slug":"a-familia-do-futuro","original_title":"Meet the Robinsons","overview":"Lewis (Daniel Hansen) é um jovem responsável por invenções brilhantes e surpreendentes. Seu mais recente trabalho é o escâner de memória, uma máquina que o ajudará a encontrar sua mãe biológica, o que permitirá que ele enfim tenha uma família. Porém antes mesmo de utilizá-la a máquina é roubada pelo Bandido do Chapéu Coco (Stephen J. Anderson). Lewis recebe então a visita de Wilbur Robinson (Wesley Singerman), um jovem misterioso que o leva em uma viagem no tempo. Já no futuro Lewis conhece os Robinsons, a família de Wilbur, que o ajudará a recuperar o escâner de memória.","first_air_date":"2007-03-23","runtime":95,"episode_run_time":[95],"vote_average":6.9,"created_by":["Walt Disney Pictures","Walt Disney Animation Studios"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Walt Disney Animation Studios"}],"cast":["Daniel Hansen","Jordan Fry","Wesley Singerman","Matthew Josten","Stephen J. Anderson"],"backdrop_path":"https://image.tmdb.org/t/p/original/jZbMhbhwaMrWosBh9dxLleWnMG8.jpg","poster_path":"https://image.tmdb.org/t/p/original/uR9rV69x4saB2vh9yfgQ5PA5E0r.jpg","certification":"L","genres":["Animação","Comédia","Família"],"trailer":"N/A"},
