"44683":{"id":"44683","name":"Tinker Bell e o Resgate da Fada","slug":"tinker-bell-e-o-resgate-da-fada","original_title":"Tinker Bell and the Great Fairy Rescue","overview":"Durante a visita das fadas às campinas floridas da Inglaterra no verão, Tinker Bell sai do acampamento em busca de coisas perdidas. Ela encontra uma pequena casa, feita por uma criança chamada Lizzie Griffiths. Curiosa, Tink explora o local, mas é alertada por Vidia de que a menina pode voltar a qualquer momento. Quando Lizzie começa a se aproximar da casa, Vidia tenta libertar Tink, que está presa dentro da estrutura, mas não adianta. Lizzie descobre Tinker Bell e a leva para casa. Ela se prepara para mostrar a fada ao seu pai, o Dr. Griffiths, um biólogo, mas ao testemunhar todas as borboletas que ele fixou em quadros de exposição, ela decide mantê-la em segredo.","first_air_date":"2010-07-29","runtime":76,"episode_run_time":[76],"vote_average":6.7,"created_by":["DisneyToon Studios","Prana Animation Studios"],"production_companies":[{"name":"DisneyToon Studios"},{"name":"Prana Animation Studios"}],"cast":["Mae Whitman","Lauren Mote","Michael Sheen","Pamela Adlon","Lucy Liu"],"backdrop_path":"https://image.tmdb.org/t/p/original/5HRAb4wHgovzICuo3ZqgHXmqzeK.jpg","poster_path":"https://image.tmdb.org/t/p/original/yY69Kxm9QP9mHL9Awswxgqr3q1C.jpg","certification":"N/A","genres":["Animação","Aventura","Família","Fantasia"],"trailer":"N/A"},
"137106":{"id":"137106","name":"Uma Aventura Lego","slug":"uma-aventura-lego","original_title":"The Lego Movie","overview":"Emmet é um Lego comum, até o dia em que é confundido com o Master Builder, o grande criador deste mundo de brinquedo, por ter encontrado a famosa peça de resistência. Este peça, procurada por todos há séculos, seria capaz de desarmar uma poderosa máquina criada pelo presidente do país, o perverso Sr. Negócios, que pretende colar todas as peças e impedir as mudanças no sistema. Mesmo sem ter grandes habilidades como criador, Emmet gosta de ser considerado um Lego especial, e faz de tudo para merecer a confiança de seus amigos, que incluem a rebelde Mega Estilo, o sábio Vitrúvius, e o gato-unicórnio UniKitty.","first_air_date":"2014-02-06","runtime":100,"episode_run_time":[100],"vote_average":7.4,"created_by":["Village Roadshow Pictures","RatPac Entertainment","LEGO","Lin Pictures","Vertigo Entertainment","Warner Bros. Pictures Animation","Animal Logic"],"production_companies":[{"name":"Village Roadshow Pictures"},{"name":"RatPac Entertainment"},{"name":"LEGO"},{"name":"Lin Pictures"},{"name":"Vertigo Entertainment"},{"name":"Warner Bros. Pictures Animation"},{"name":"Animal Logic"}],"cast":["Chris Pratt","Elizabeth Banks","Will Ferrell","Morgan Freeman","Will Arnett"],"backdrop_path":"https://image.tmdb.org/t/p/original/9531Jp42H0ppRXjkxxgCulnQNZp.jpg","poster_path":"https://image.tmdb.org/t/p/original/yFAP5ePJuKaiFNm0h3hi3P3p19E.jpg","certification":"L","genres":["Animação","Família","Aventura","Comédia","Fantasia"],"trailer":"N/A"},
"10112":{"id":"10112","name":"Aristogatas","slug":"aristogatas","original_title":"The Aristocats","overview":"Uma milionária excêntrica pretende deixar toda sua fortuna para sua gata e os três filhotes. Porém, o mordomo dela os abandona no interior da França para se tornar o beneficiário de toda a herança. Contando com a ajuda de um esperto gato das ruas e de seus amigos, os herdeiros tentam voltar para seu lar e confrontar o maldoso mordomo.","first_air_date":"1970-12-24","runtime":78,"episode_run_time":[78],"vote_average":7.3,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Phil Harris","Eva Gabor","Sterling Holloway","Scatman Crothers","Paul Winchell"],"backdrop_path":"https://image.tmdb.org/t/p/original/oM5mMTGBqsmMJO3l5tkQdQ0Xujm.jpg","poster_path":"https://image.tmdb.org/t/p/original/iqp5afP5Wc18iu16FXxBrsh9dnd.jpg","certification":"L","genres":["Animação","Comédia","Família","Aventura"],"trailer":"N/A"},
"10315":{"id":"10315","name":"O Fantástico Sr. Raposo","slug":"o-fantastico-sr-raposo","original_title":"Fantastic Mr. Fox","overview":"O Sr. Raposo e a Sra. Raposa levam uma vida feliz com seu filho excêntrico Ash e Kristofferson, o sobrinho que está de visita. Isso até o Sr. Raposo voltar aos velhos hábitos e planejar o maior roubo de galinhas que o mundo animal já viu.","first_air_date":"2009-10-23","runtime":87,"episode_run_time":[87],"vote_average":7.8,"created_by":["Regency Enterprises","Indian Paintbrush","American Empirical Pictures"],"production_companies":[{"name":"Regency Enterprises"},{"name":"Indian Paintbrush"},{"name":"American Empirical Pictures"}],"cast":["George Clooney","Meryl Streep","Jason Schwartzman","Wallace Wolodarsky","Eric Chase Anderson"],"backdrop_path":"https://image.tmdb.org/t/p/original/qU4HDNKv7gjdlvMu74r70rISPwn.jpg","poster_path":"https://image.tmdb.org/t/p/original/shnKG2crnnCEToZHdxsiM2uDsKs.jpg","certification":"N/A","genres":["Aventura","Animação","Comédia","Família"],"trailer":"N/A"},
"5255":{"id":"5255","name":"O Expresso Polar","slug":"o-expresso-polar","original_title":"The Polar Express","overview":"Acorde, caia na real e esteja pronto para a jornada de sua vida! É véspera de Natal e um garoto está acordado. Sem acreditar mais em Papai Noel, ele espera por algo que faça com que sua crença na figura natalina retorne. De repente ele ouve um grande barulho, de fora de sua casa. O garoto então vê à sua frente um gigantesco trem negro com destino ao Pólo Norte, cujo condutor o convida para embarcar. Após certa relutância, ele decide seguir viagem. Você está prestes a embarcar em uma verdadeira montanha-russa que o levará para cima e para baixo através de montanhas, campos gelados e pontes gigantescas, saboreando chocolate quente. Você está a bordo do Expresso Polar!","first_air_date":"2004-11-10","runtime":100,"episode_run_time":[100],"vote_average":6.7,"created_by":["Golden Mean","Playtone","ImageMovers","Castle Rock Entertainment","Shangri-La Entertainment"],"production_companies":[{"name":"Golden Mean"},{"name":"Playtone"},{"name":"ImageMovers"},{"name":"Castle Rock Entertainment"},{"name":"Shangri-La Entertainment"}],"cast":["Tom Hanks","Leslie Zemeckis","Eddie Deezen","Nona Gaye","Peter Scolari"],"backdrop_path":"https://image.tmdb.org/t/p/original/y8Mabq84N0d5fm83CWb9Zkltkwr.jpg","poster_path":"https://image.tmdb.org/t/p/original/adXE99ie9wBdpdvdrB2HDpl9aoV.jpg","certification":"L","genres":["Animação","Aventura","Família","Fantasia"],"trailer":"N/A"},
