"454640":{"id":"454640","name":"Angry Birds 2: O Filme","slug":"angry-birds-2-o-filme","original_title":"The Angry Birds Movie 2","overview":"Red e seus amigos dedicam a vida a proteger a Ilha dos Pássaros dos constantes ataques vindos da Ilha dos Porcos. Entretanto, quanto uma terceira ilha surge e começa a atacá-los, Leonardo, o rei dos porcos, decide procurar seu arqui-inimigo em busca de uma trégua para que, juntos, possam enfrentar a ameaça em comum.","first_air_date":"2019-08-02","runtime":97,"episode_run_time":[97],"vote_average":7.1,"created_by":["Rovio Animation","Columbia Pictures","Sony Pictures Animation","Rovio Entertainment"],"production_companies":[{"name":"Rovio Animation"},{"name":"Columbia Pictures"},{"name":"Sony Pictures Animation"},{"name":"Rovio Entertainment"}],"cast":["Jason Sudeikis","Josh Gad","Danny McBride","Leslie Jones","Bill Hader"],"backdrop_path":"https://image.tmdb.org/t/p/original/tntH2nSeaGTOXV6CITPSvczSiXw.jpg","poster_path":"https://image.tmdb.org/t/p/original/pMqAjEyj234escPleCthcmh84ka.jpg","certification":"L","genres":["Animação","Ação","Fantasia","Aventura","Comédia","Família"],"trailer":"eCnw18_rboc"},
"13683":{"id":"13683","name":"Tarzan e Jane","slug":"tarzan-e-jane","original_title":"Tarzan & Jane","overview":"Tarzan e Jane comemoram seu primeiro ano de vida juntos na floresta. Jane procura o presente perfeito para Tarzan. Enquanto o grupo relembra as muitas aventuras vividas até então, Jane percebe como aquele ano na selva foi divertido: os encontros com velhos amigos, novos adversários, a vitória sobre as panteras ferozes e o surfe na lava dentro de um vulcão em erupção. Embora venham de mundos diferentes, Tarzan e Jane descobrem que, juntos, são invencíveis.","first_air_date":"2002-06-24","runtime":75,"episode_run_time":[75],"vote_average":6.0,"created_by":["Disney Television Animation"],"production_companies":[{"name":"Disney Television Animation"}],"cast":["Michael T. Weiss","Olivia d'Abo","Jeff Bennett","Jim Cummings","April Winchell"],"backdrop_path":"https://image.tmdb.org/t/p/original/x2FeMuxOL6vZt7VY8XlGWUniMcg.jpg","poster_path":"https://image.tmdb.org/t/p/original/dZTg8Z2DuVx7SgEKD1nHYZBQMm6.jpg","certification":"N/A","genres":["Animação","Família"],"trailer":"N/A"},
"7443":{"id":"7443","name":"A Fuga das Galinhas","slug":"a-fuga-das-galinhas","original_title":"Chicken Run","overview":"No galinheiro de uma fazenda inglesa dos anos 1950, galinhas cumprem sua função e vivem pacatamente sonhando com uma vida melhor. Uma delas, Ginger, sonha com a liberdade e planeja sair voando dali junto com suas companheiras.","first_air_date":"2000-06-23","runtime":84,"episode_run_time":[84],"vote_average":6.8,"created_by":["Aardman","DreamWorks Animation","Pathé","DreamWorks Pictures"],"production_companies":[{"name":"Aardman"},{"name":"DreamWorks Animation"},{"name":"Pathé"},{"name":"DreamWorks Pictures"}],"cast":["Julia Sawalha","Mel Gibson","Imelda Staunton","Jane Horrocks","Lynn Ferguson"],"backdrop_path":"https://image.tmdb.org/t/p/original/xWG7emUlBPhsJ2MyQHqH0poeXwm.jpg","poster_path":"https://image.tmdb.org/t/p/original/hp5shw8xyuYId322rT9am3HrKCQ.jpg","certification":"L","genres":["Animação","Comédia","Família"],"trailer":"aO_ao9cX_To"},
"22794":{"id":"22794","name":"Tá Chovendo Hambúrguer","slug":"ta-chovendo-hamburguer","original_title":"Cloudy with a Chance of Meatballs","overview":"Flint Lockwood é um jovem cientista que sonha criar algo que faça com que seja reconhecido pela população de Boca Grande, uma pequena ilha no Atlântico. Um dia ele consegue descobrir uma forma de transformar água em comida, só que precisa de bastante eletricidade para colocá-la em funcionamento. Ao tentar usar a energia da geradora local, ele perde o controle da invenção e ela ruma para o céu. Para piorar, a confusão que ele cria destroi um parque de diversões, o grande trunfo do prefeito Shelbourne para melhorar a economia local. Flint acredita ter perdido a máquina, mas repentinamente começa a chover hambúrgueres em toda a cidade. Com o apoio de Sam Sparks, uma estagiária de jornalismo que foi enviada à ilha para ser a nova \"garota do tempo\", Flint logo vira uma celebridade local.","first_air_date":"2009-09-17","runtime":90,"episode_run_time":[90],"vote_average":6.6,"created_by":["Sony Pictures Animation","Columbia Pictures"],"production_companies":[{"name":"Sony Pictures Animation"},{"name":"Columbia Pictures"}],"cast":["Bill Hader","Anna Faris","James Caan","Andy Samberg","Bruce Campbell"],"backdrop_path":"https://image.tmdb.org/t/p/original/cslS1Er64IP0t5VKCqQh435NeFd.jpg","poster_path":"https://image.tmdb.org/t/p/original/2vrHwe0SW9NL8UViemUVALVyECl.jpg","certification":"L","genres":["Animação","Comédia","Família"],"trailer":"g8bdoFCgIh8"},
