"9479":{"id":"9479","name":"O Estranho Mundo de Jack","slug":"o-estranho-mundo-de-jack","original_title":"The Nightmare Before Christmas","overview":"Jack Skellington, o Rei das Abóboras, se cansa de fazer o Dia das Bruxas todos os anos e deixa os limites da cidade. Por acaso, acaba atravessando o portal do Natal, onde vê a alegria do espírito natalino. Ao retornar para a Cidade do Halloween, sem ter compreendido o que viu, ele começa a convencer os cidadãos a sequestrarem o Papai Noel e fazerem seu próprio Natal. Apesar de sua leal namorada Sally ser contra, o Papai Noel é capturado e os fatos mostrarão que Sally estava certa o tempo todo.","first_air_date":"1993-10-09","runtime":76,"episode_run_time":[76],"vote_average":7.8,"created_by":["Touchstone Pictures","Skellington Productions"],"production_companies":[{"name":"Touchstone Pictures"},{"name":"Skellington Productions"}],"cast":["Danny Elfman","Chris Sarandon","Catherine O'Hara","William Hickey","Glenn Shadix"],"backdrop_path":"https://image.tmdb.org/t/p/original/xWT5F1DNxciNLEMXRl49iq8zvN7.jpg","poster_path":"https://image.tmdb.org/t/p/original/pyMGhuAWC7nYyolKJlFbT7pp02K.jpg","certification":"L","genres":["Fantasia","Animação","Família"],"trailer":"N/A"},
