"36728":{"id":"36728","name":"Naruto Shippuden o Filme: Herdeiros da Vontade do Fogo","slug":"naruto-shippuden-o-filme-herdeiros-da-vontade-do-fogo","original_title":"劇場版 NARUTO -ナルト- 疾風伝 火の意志を継ぐ者","overview":"Entre os cinco grandes países de shinobi, os países da Água, Terra, Trovão e Vento estão perdendo seus Kekkei Genkai, um atrás do outro. O único que não foi afetado foi o País de Fogo, os outros começam a suspeitar que isto não é nenhuma coincidência. Embora a tensão da situação pode levar a uma nova Guerra Shinobi, Kakashi desaparece da aldeia, qual será o motivo...!? Entretanto os 11 de konoha vão por vontade própria em busca de Kakashi acabando por enfrentar o bando de shinobis desconhecidos... como correrá?","first_air_date":"2009-08-01","runtime":95,"episode_run_time":[95],"vote_average":7.3,"created_by":["Pierrot","TV Tokyo","Shueisha","Aniplex","dentsu","Bandai"],"production_companies":[{"name":"Pierrot"},{"name":"TV Tokyo"},{"name":"Shueisha"},{"name":"Aniplex"},{"name":"dentsu"},{"name":"Bandai"}],"cast":["竹内順子","中村千絵","Kazuhiko Inoue","Romi Park","Satoshi Hino"],"backdrop_path":"https://image.tmdb.org/t/p/original/fq5r99Uwr0TEG1yc903LgPNNA9k.jpg","poster_path":"https://image.tmdb.org/t/p/original/7TQFZZQhai2MY0FoWsWAMMtYANb.jpg","certification":"N/A","genres":["Ação","Aventura","Comédia","Drama","Fantasia","Animação"],"trailer":"N/A"},
