"228161":{"id":"228161","name":"Cada Um na Sua Casa","slug":"cada-um-na-sua-casa","original_title":"Home","overview":"O planeta Terra foi invadido por seres extra-terrestres, os Boov, que estão em busca de um novo planeta para chamar de lar. Eles convivem com os humanos pacificamente, que não sabem de sua existência. Entretanto, um dia a jovem adolescente Tip encontra o alien Oh, que foi banido pelos Boov devido às várias trapalhadas causadas por ele. Os dois logo embarcam em uma aventura onde aprendem bastante sobre as relações intergalácticas.","first_air_date":"2015-03-18","runtime":94,"episode_run_time":[94],"vote_average":6.8,"created_by":["DreamWorks Animation"],"production_companies":[{"name":"DreamWorks Animation"}],"cast":["Jim Parsons","Rihanna","Steve Martin","Jennifer Lopez","Matt Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/gnkBzJVH2zicIopP2fHf4kRElne.jpg","poster_path":"https://image.tmdb.org/t/p/original/oPaWNQKrQ3enUzNbEQqadWGAuwJ.jpg","certification":"L","genres":["Fantasia","Comédia","Animação","Ficção científica","Família"],"trailer":"Lh3pM8WS6tw"},
