"127380":{"id":"127380","name":"Procurando Dory","slug":"procurando-dory","original_title":"Finding Dory","overview":"Um ano depois dos acontecimentos narrados em “Procurando Nemo”, Dory convive em paz com Marlin e seu filho Nemo. Mas durante uma viagem para ver como as arraias migram de volta para casa, os problemas de memória de Dory parecem desaparecer por um segundo: ela lembra que tem família e imediatamente decide fazer uma viagem para reencontrar os pais, que perdeu anos atrás.","first_air_date":"2016-06-16","runtime":97,"episode_run_time":[97],"vote_average":7.0,"created_by":["Pixar","Walt Disney Pictures"],"production_companies":[{"name":"Pixar"},{"name":"Walt Disney Pictures"}],"cast":["Albert Brooks","Ellen DeGeneres","Ed O'Neill","Hayden Rolence","Diane Keaton"],"backdrop_path":"https://image.tmdb.org/t/p/original/wijltj1toRcicHlCn8Cpsp4yPXe.jpg","poster_path":"https://image.tmdb.org/t/p/original/iq0bBYiDe7ttTNBtTwMBqBLPCXJ.jpg","certification":"L","genres":["Aventura","Animação","Comédia","Família"],"trailer":"BGNvbWeASbA"},
