"14128":{"id":"14128","name":"Cinderela II: Os Sonhos Se Realizam","slug":"cinderela-ii-os-sonhos-se-realizam","original_title":"Cinderella II: Dreams Come True","overview":"Como a princesa recém-coroada, Cinderela logo percebe que a vida no palácio – e suas responsabilidades reais – são mais complicadas do que ela imaginava. Em três contos emocionantes, Cinderela busca a ajuda de seus amigos animais e de sua Fada Madrinha enquanto usa graça e encantamento em sua régia posição e descobre que ser verdadeira consigo mesma é a melhor maneira de fazer seus sonhos se realizarem.","first_air_date":"2002-02-23","runtime":73,"episode_run_time":[73],"vote_average":6.1,"created_by":["Walt Disney Animation Japan","Disney Television Animation"],"production_companies":[{"name":"Walt Disney Animation Japan"},{"name":"Disney Television Animation"}],"cast":["Jennifer Hale","Rob Paulsen","Corey Burton","Andre Stojka","Russi Taylor"],"backdrop_path":"https://image.tmdb.org/t/p/original/oyjIJTUUsF1nMdVXk3Q0ExBr0pQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/bDYXOB4JMnVI6Rx3HGuJmTluQyN.jpg","certification":"L","genres":["Família","Animação","Romance","Fantasia"],"trailer":"j13eirTfY7E"},
