"9982":{"id":"9982","name":"O Galinho Chicken Little","slug":"o-galinho-chicken-little","original_title":"Chicken Little","overview":"Chicken Little é um galo cheio de imaginação que apronta as maiores confusões. Um dia, ele provoca pânico generalizado na cidade onde vive, ao confundir a queda de uma avelã com um pedaço do céu despencando. Após a verdade vir à tona, o galinho perde todo o crédito junto aos habitantes. Porém, quando um pedaço do céu realmente cai em sua cabeça e ele identifica que se trata de um alienígena, Chicken Little precisa salvar a cidade sem fazer com que todos entrem em pânico mais uma vez.","first_air_date":"2005-11-04","runtime":81,"episode_run_time":[81],"vote_average":5.9,"created_by":["Walt Disney Pictures","Walt Disney Feature Animation"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Walt Disney Feature Animation"}],"cast":["Zach Braff","Garry Marshall","Don Knotts","Amy Sedaris","Steve Zahn"],"backdrop_path":"https://image.tmdb.org/t/p/original/neaUbI8fDtfnitw81ovBN0av8xE.jpg","poster_path":"https://image.tmdb.org/t/p/original/fUCBkuNWpAIfH6yhuRzujy5Zjv0.jpg","certification":"L","genres":["Animação","Família","Comédia"],"trailer":"N/A"},
