"13700":{"id":"13700","name":"Nem Que a Vaca Tussa","slug":"nem-que-a-vaca-tussa","original_title":"Home on the Range","overview":"A fazenda Caminho do Paraíso está em pânico, pois uma ação de despejo ameaça acabar com o local. Temendo ir para o matadouro, os animais da fazenda decidem ajudar a dona a conseguir a quantia necessária para pagar a hipoteca. O alvo escolhido pelo grupo é o perigoso bandido Alameda Slim, que tem uma grande recompensa reservada para quem capturá-lo.","first_air_date":"2004-04-02","runtime":77,"episode_run_time":[77],"vote_average":6.1,"created_by":["Walt Disney Pictures","Walt Disney Feature Animation"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Walt Disney Feature Animation"}],"cast":["Roseanne Barr","Judi Dench","Jennifer Tilly","Steve Buscemi","G.W. Bailey"],"backdrop_path":"https://image.tmdb.org/t/p/original/rmJ6ecnd1XD8rmRGrV7ZkHhbotA.jpg","poster_path":"https://image.tmdb.org/t/p/original/merEoWh2Ju8AoYedYCW0faW9e9O.jpg","certification":"L","genres":["Animação","Família"],"trailer":"N/A"},
